export enum PeopleOptions {
    None = 'None',
    LessThan2 = 'LessThan2',
    ThreeToFour = 'ThreeToFour',
    MoreThan4 = 'MoreThan4'
}

export enum TableSize {
    Lessthan2 = 'Two People Table',
    ThreeToFour = 'Four People Table',
    MoreThan4 = 'Eight People Table'
}
